function Menu() 
{
  return(<nav className="Menu">
    <Link to={`/`} className="logo" ><img className='Menu_logo' src={logo} alt=''/></Link>
    <Categories/>
    <Searchbar/>
    <Cart/>
    <Account/>

  </nav>)
}

